  base: *id013
  body: "Currently DateMathParser with `roundUp = true` is relying on the DateFormatter\
    \ build with combined optional sub parsers with defaulted fields (depending on\
    \ the formatter). That means that for  `yyyy-MM-dd'T'HH:mm:ss||yyyy-MM-dd'T'HH:mm:ss.SSS`\
    \  \r\nJava.time implementation expects optional parsers in order from most specific\
    \ to least specific  (reverse in the example above). \r\nIt is causing a problem\
    \ because the first parsing succeeds but does not consume the full input. The\
    \ second  parser should be used.\r\nWe can work around this with keeping a list\
    \ of RoundUpParsers and iterate over them choosing the one that parsed full input.\
    \ The same approach we used for regular (non date math) in\r\nrelates https://github.com/elastic/elasticsearch/pull/40100\r\
    \nThe jdk is not  considering this to be a bug https://bugs.openjdk.java.net/browse/JDK-8188771\r\
    \n\r\nThose below will expect this change first\r\nrelates https://github.com/elastic/elasticsearch/pull/46242\r\
    \nrelates https://github.com/elastic/elasticsearch/issues/45284\r\n"
